import styled from 'styled-components'

const Container=styled.div`
display:flex;
flex-direction:column;
position: absolute;
align-items:center;
width: 1512px;
height: 6723px;
top: 1290px;`

const Data=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
margin:50px;
gap: 40px;
`
const DataBlock=styled.div`
width: 256px;
height: 160px;
display: flex;
flex-direction:column;
gap:10px;
align-items: center;
text-align: center;
letter-spacing: -1.2px;`

const Num=styled.div`
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 37px;
line-height: 48px;
color: #061237;
`
const Head=styled.div`
font-family: 'Inter';
font-style: normal;
font-weight: 500;
font-size: 16px;
line-height: 32px;
letter-spacing: -0.16px;
color: #061237;
`
const Disc=styled.div`
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 16px;
line-height: 32px;
letter-spacing: -0.16px;
color: #67718E;
`
const VideoDiv=styled.div`
position: absolute;
width: 992px;
height: 908px;
top: 448px;
`

const VideoTitle=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
isolation: isolate;
width: 992px;
height: 64px;
left: 0px;
top: 0px;`

const GreyDiv=styled.div`
position: absolute;
width: 64px;
height: 64px;
left: 0px;
top: 0px;
background: #F7F9FC;`

const Title=styled.p`
position:absolute;
top:20px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 14px;
line-height: 24px;
letter-spacing: 1.5px;
text-transform: uppercase;
color: #67718E;
z-index: 1;
`

const VideoHead=styled.div``
const Video=styled.div``
const VideoDesc=styled.div``

const Info = () => {
  return (
    <Container>
        <Data>
          <DataBlock>
            <Num>99.95%</Num>
            <Head>Accuracy rate</Head>
            <Disc>in fulfilling orders</Disc>
          </DataBlock>
          <DataBlock>
            <Num>5,000+</Num>
            <Head>Ecommerce businesses</Head>
            <Disc>partner with Opus</Disc>
          </DataBlock>
          <DataBlock>
            <Num>99.96%</Num>
            <Head>Of orders ship on time</Head>
            <Disc>within SLA</Disc>
          </DataBlock>
          <DataBlock>
            <Num>#1</Num>
            <Head>Best Fulfillment Technology</Head>
            <Disc>by AdWeekâ€™s Retail Awards</Disc>
          </DataBlock>
        </Data>
        <VideoDiv>
          <VideoTitle>
            <GreyDiv></GreyDiv>
            <Title>VIDEO TITLE</Title>
          </VideoTitle>
          <VideoHead></VideoHead>
          <Video></Video>
          <VideoDesc></VideoDesc>
        </VideoDiv>
    </Container>
  )
}

export default Info
